const getAnswers = () => {
    const answers = {
        options: [
            { id: 0, text: "Strongly Agree",},
            { id: 1, text: "Agree",},
            { id: 2, text: "Unsure"},
            { id: 3, text: "Disagree",},
            { id: 4, text: "Strongly Disagree", }
        ],
        }
}

export default getAnswers;
